import React from 'react';
import style from './UpButton.module.css';

export default function UpButton() {
  return <button className={style.up_button}>
    <svg className={style.up_button__lines} viewBox="0 0 30 30">
        <line x1="15" y1="0" x2="15" y2="45" stroke="#765373" strokeWidth="1.5"/>
        <line x1="15" y1="0" x2="0" y2="25" stroke="#765373" strokeWidth="1.5"/>
        <line x1="15" y1="0" x2="30" y2="25" stroke="#765373" strokeWidth="1.5"/>
    </svg>
  </button>;
}
